import React from 'react'
import Create from './component/Create';
import {BrowserRouter as Router, Route} from 'react-router-dom'
import Navigation from './component/Navigation';

function App() {
  return (
    <>
    <Navigation/>
    <Router>

    <div>
  <Route exact path='/create' component={<Create/>} />
    </div>
    </Router>
    </>
  )
}

export default App
